const Home = () => {

  const [levels, setDict] = useState([]);
  const getDict = async () => {
    try {
      const response = await fetch("http://localhost:5000");
      const jsonData = await response.json();
      setDict(jsonData);
      //console.log(levels);
    } catch (err) {
      console.error(err.message);
    }
  };


  const prom_level = [];
  for (const key in levels.PANDEV) {
    prom_level.push(levels.PANDEV);
  }

  console.log(levels.PANDEV);
  useEffect(() => {
    getDict();
  }, []);

  const levels_test = {"1":1, "2":2, "3":3, "4":4}
