    <table class="table mt-5 text-center">
      <thead>
        <tr>
          <th>Description</th>
          <th>Edit</th>
          <th>Delete</th>
        </tr>
      </thead>
      <tbody>
        {Object.keys(levels.PANDEV).map((key, index) => (
          <tr>
            <td>{levels.PANDEV[key]}</td>
            <td>
              {levels.PANDEV[key]}
            </td>
            <td>
              {key}
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default Home;
